import React from 'react';

class Header extends React.Component{

    render(){

        return(
            <header>
                <div className="logo"></div>
                <ul className="nav">
                    <li>Home</li>
                    <li subnav>
                        Shopping
                        <ul className="sub-nav">
                            <li>Man</li>
                            <li>Women</li>
                            <li>Sale</li>
                        </ul>
                    </li>
                    <li>About Us</li>
                    <li>Contact Us</li>
                    <li>My Account</li>
                </ul>
            </header>
        );
    }

}

export default Header;
